import React, { Component } from "react";
import Card from "pnnl-react-core/lib/Card";
import Grid from "react-bootstrap/es/Grid";
import Row from "react-bootstrap/es/Row";
import Col from "react-bootstrap/es/Col";
import ELFPlot from "./ELFPlot";
import Data from "../../../Data/CIE_1931";
import CIEPlot from "./CIEPlot";

export class Graphical extends Component {
  constructor(props) {
    super(props);
    this.tm30 = this.props.tm30;
    console.log(Data.Spectrum_Locus.x);
  }
  render() {
    return (
      <Grid>
        <Row>
          <h2 align="center">Test Source and Reference Illuminant </h2>
        </Row>
        <Row>
          <Card className="SideScroll">
            <ELFPlot
              test={this.tm30.normalized_SPD_test}
              ref_spd={this.tm30.normalized_SPD_ref}
            ></ELFPlot>

            <CIEPlot
              spectrum_locus_x={Data.Spectrum_Locus.x}
              spectrum_locus_y={Data.Spectrum_Locus.y}
              blackbody_locus_x={Data.blackbody_locus_x.x}
              blackbody_locus_y={Data.blackbody_locus_x.y}
            ></CIEPlot>

            <ELFPlot
              test={this.tm30.normalized_SPD_test}
              ref_spd={this.tm30.normalized_SPD_ref}
            ></ELFPlot>
          </Card>
        </Row>
      </Grid>
    );
  }
}

export default Graphical;
